import React from "react";
import {
  Route,
  Routes,
  Link,
  Outlet,
  useMatch,
  useParams,
} from "react-router-dom";

const ContactList = () => {
  let { path, url } = useMatch();
  console.log(url);
  return (
    <div>
      <p>Contact List</p>
    </div>
  );
};

const CreateData = () => {
  return (
    <NavContact>
      <p>New Data</p>
    </NavContact>
  );
};

const UpdateData = () => {
  return (
    <NavContact>
      <p>Update Data</p>
    </NavContact>
  );
};

const NavContact = ({ children }) => {
  return (
    <div>
      <nav>
        <Link to="/contact/create">Create</Link> |
        <Link to="/contact/update">Update</Link>
      </nav>
      {children}
    </div>
  );
};

const Contact = () => {
  return (
    <Routes>
      <Route path="/" element={<NavContact />} />
      <Route path="/list" element={<ContactList />} />
      <Route path="/create" element={<CreateData />} />
      <Route path="/update" element={<UpdateData />} />
      <Route path="*" element={<h1>Not found page</h1>} />
    </Routes>
  );
};

export default Contact;
